import React from 'react';
import "./About.css";

function About() {
    return (
        <div>
            <h1 className="AboutH1 fadeInLeft">About Me</h1>
            <div className="AboutP fadeInUp">Sugene Mulpuri is a software developer with 8 years of overall experience in IT and over 4 years of experience in email marketing. He graduated from Michigan State University with a Bachelors of Science degree in Psychology. He made a jump to web development in 2019 through a training program and worked building small scale documents as he got into the email marketing field. He is drawn to front-end development by the direct results you can see change as you change code, as it is a sort of guidance to the right direction.</div>
            <div className="AboutP fadeInUp"><img src="./images/Chicago-Night" /></div><br />
            <br />
            Here are some pictures of him at various stages of his life:

        </div>
    )
}

export default About;
